import{_ as t,o as e,c as n,X as r}from"./chunks/framework.319defb2.js";const x=JSON.parse('{"title":"Support Policy","description":"Support Policy","frontmatter":{"description":"Support Policy"},"headers":[],"relativePath":"docs/reference/support-policy.md","filePath":"docs/reference/support-policy.md"}'),l={name:"docs/reference/support-policy.md"},i=r('<h1 id="support-policy" tabindex="-1">Support Policy <a class="header-anchor" href="#support-policy" aria-label="Permalink to &quot;Support Policy&quot;">​</a></h1><h2 id="community-maintenance" tabindex="-1">Community Maintenance <a class="header-anchor" href="#community-maintenance" aria-label="Permalink to &quot;Community Maintenance&quot;">​</a></h2><p>Stencil is a 100% open source (MIT) project. Developers can ensure Stencil is the right choice for building web components through Ionic’s community maintenance strategy. The Stencil team regularly ships new releases, bug fixes, and is welcoming to community pull requests.</p><h2 id="stencil-maintenance-and-support-status" tabindex="-1">Stencil Maintenance and Support Status <a class="header-anchor" href="#stencil-maintenance-and-support-status" aria-label="Permalink to &quot;Stencil Maintenance and Support Status&quot;">​</a></h2><p>Given the reality of time and resource constraints as well as the desire to keep innovating in the frontend development space, over time it becomes necessary for the Stencil team to shift focus to newer versions of the library. However, the Stencil team will do everything it can to make the transition to newer versions as smooth as possible. The Stencil team recommends updating to the newest version of the Stencil for the latest features, improvements and stability updates.</p><p>The current status of each Stencil version is:</p><table><thead><tr><th style="text-align:center;">Version</th><th style="text-align:center;">Status</th><th style="text-align:center;">Released</th><th style="text-align:center;">Maintenance Ends</th><th style="text-align:center;">Ext. Support Ends</th></tr></thead><tbody><tr><td style="text-align:center;">V4</td><td style="text-align:center;"><strong>Active</strong></td><td style="text-align:center;">Jun 26, 2023</td><td style="text-align:center;">TBD</td><td style="text-align:center;">TBD</td></tr><tr><td style="text-align:center;">V3</td><td style="text-align:center;">Maintenance</td><td style="text-align:center;">Jan 25, 2023</td><td style="text-align:center;">Dec 26, 2023</td><td style="text-align:center;">Jun 26, 2024</td></tr><tr><td style="text-align:center;">V2</td><td style="text-align:center;">Maintenance</td><td style="text-align:center;">Aug 08, 2020</td><td style="text-align:center;">Jul 25, 2023</td><td style="text-align:center;">Jan 25, 2024</td></tr><tr><td style="text-align:center;">V1</td><td style="text-align:center;">End of Support</td><td style="text-align:center;">Jun 03, 2019</td><td style="text-align:center;">Aug 08, 2020</td><td style="text-align:center;">Aug 08, 2020</td></tr></tbody></table><p><strong>Maintenance Period</strong>: Only critical bug and security fixes. No major feature improvements.</p><p><strong>Extended Support Period</strong>: Available to Stencil Enterprise customers.</p><h3 id="stencil-support-details" tabindex="-1">Stencil Support Details <a class="header-anchor" href="#stencil-support-details" aria-label="Permalink to &quot;Stencil Support Details&quot;">​</a></h3><p>Starting with Stencil v2, the Stencil team is adopting a newly revised maintenance policy. When a new major version of Stencil is released, the previous major version release will enter maintenance mode. While a version of Stencil is in maintenance mode, only critical bug &amp; security fixes will be applied to that version, and no major feature improvements will be added. The maintenance period shall last six months from the release of the new major version.</p><p>Once the maintenance period has ended for a version of Stencil, that version enters the extended support period. During the extended support period, only critical bug and security fixes will be applied for teams and organizations using Stencil&#39;s Enterprise offerings. The extended support period lasts for twelve months from the release of the new major version.</p><p>The table below describes a theoretical timeline of releases:</p><table><thead><tr><th style="text-align:center;">Version</th><th style="text-align:center;">Status</th><th style="text-align:center;">Released</th><th style="text-align:center;">Maintenance Ends</th><th style="text-align:center;">Ext. Support Ends</th></tr></thead><tbody><tr><td style="text-align:center;">D</td><td style="text-align:center;">Active</td><td style="text-align:center;">Jan 01, 2022</td><td style="text-align:center;">TBD</td><td style="text-align:center;">TBD</td></tr><tr><td style="text-align:center;">C</td><td style="text-align:center;">Maintenance</td><td style="text-align:center;">Jul 07, 2021</td><td style="text-align:center;">Jul 01, 2022</td><td style="text-align:center;">Jan 01, 2023</td></tr><tr><td style="text-align:center;">B</td><td style="text-align:center;">Extended Support Only</td><td style="text-align:center;">Jan 01, 2021</td><td style="text-align:center;">Jan 07, 2022</td><td style="text-align:center;">Jul 07, 2022</td></tr><tr><td style="text-align:center;">A</td><td style="text-align:center;">End of Support</td><td style="text-align:center;">Jul 07, 2020</td><td style="text-align:center;">Jul 01, 2021</td><td style="text-align:center;">Jan 01, 2021</td></tr></tbody></table><p>In the example above, when Version D is released, Version C enters maintenance mode. Version D was released on January 1st, 2022. Version C shall be in maintenance mode until July 1st, 2022, three months after the release of Version D. After July 1st 2022, Version C will be in extended support until Jun 1st, 2023, twelve months after the release of Version D.</p><h2 id="browser-support" tabindex="-1">Browser Support <a class="header-anchor" href="#browser-support" aria-label="Permalink to &quot;Browser Support{#browser-support}&quot;">​</a></h2><p>Stencil builds Web Components that run natively in all widely used desktop and mobile browsers. Custom Elements are natively supported in Chrome, Edge, Firefox, and Safari (including iOS)!</p><p>Stencil supports the following browsers:</p><table><thead><tr><th style="text-align:center;">Stencil Version</th><th style="text-align:center;">Chrome</th><th style="text-align:center;">Edge</th><th style="text-align:center;">Firefox</th><th style="text-align:center;">Safari</th><th style="text-align:center;">Internet Explorer</th><th style="text-align:center;">Pre-Chromium Edge</th></tr></thead><tbody><tr><td style="text-align:center;">V4</td><td style="text-align:center;">v79+</td><td style="text-align:center;">v79+</td><td style="text-align:center;">v70+</td><td style="text-align:center;">v14+</td><td style="text-align:center;">❌</td><td style="text-align:center;">❌</td></tr><tr><td style="text-align:center;">V3</td><td style="text-align:center;">v79+</td><td style="text-align:center;">v79+</td><td style="text-align:center;">v70+</td><td style="text-align:center;">v14+</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td></tr><tr><td style="text-align:center;">V2</td><td style="text-align:center;">v60+</td><td style="text-align:center;">v79+</td><td style="text-align:center;">v63+</td><td style="text-align:center;">v10.1+</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td></tr></tbody></table><h2 id="typescript-support" tabindex="-1">TypeScript Support <a class="header-anchor" href="#typescript-support" aria-label="Permalink to &quot;TypeScript Support&quot;">​</a></h2><p>Stencil acts as a compiler for a project&#39;s web components, and works closely with the TypeScript compiler to transform TSX to vanilla JavaScript. To ensure compatibility between the two, Stencil takes an opinionated stance on which version of the TypeScript compiler must be used.</p><p>Stencil includes a recent copy of the TypeScript compiler in its distributable* to guarantee this compatibility. The Stencil team is committed to keeping its version of TypeScript up to date and, as of Stencil v2.10.0, attempts to be within one minor version of the latest TypeScript release.</p><p>The table below describes recent versions of Stencil and the version of TypeScript each version shipped with.</p><table><thead><tr><th style="text-align:center;">Stencil Version</th><th style="text-align:center;">TypeScript Version</th></tr></thead><tbody><tr><td style="text-align:center;">v3.3.0</td><td style="text-align:center;">v5.0.4</td></tr><tr><td style="text-align:center;">v3.0.0</td><td style="text-align:center;">v4.9.4</td></tr><tr><td style="text-align:center;">v2.21.0</td><td style="text-align:center;">v4.9.3</td></tr><tr><td style="text-align:center;">v2.20.0</td><td style="text-align:center;">v4.8.4</td></tr><tr><td style="text-align:center;">v2.18.0</td><td style="text-align:center;">v4.7.4</td></tr><tr><td style="text-align:center;">v2.14.0</td><td style="text-align:center;">v4.5.4</td></tr><tr><td style="text-align:center;">v2.10.0</td><td style="text-align:center;">v4.3.5</td></tr><tr><td style="text-align:center;">v2.5.0</td><td style="text-align:center;">v4.2.3</td></tr><tr><td style="text-align:center;">v2.4.0</td><td style="text-align:center;">v4.1.3</td></tr><tr><td style="text-align:center;">v2.2.0</td><td style="text-align:center;">v4.0.5</td></tr></tbody></table><p>The TypeScript team releases a new minor version of the TypeScript compiler approximately once every three months. To accomplish its goal of staying within one minor version of the latest release, Stencil will update its version of TypeScript once every three months as well. Updates to the version of TypeScript will often, but not always, occur in a <a href="./versioning.html#minor-release">minor version release</a> of Stencil.</p><p>The Stencil team acknowledges that TypeScript minor version releases may contain breaking changes. The Stencil team will do everything in its power to avoid propagating breaking changes to its user base.</p><p>* The TypeScript compiler is never included in the output of your Stencil project, and is only used for compilation and type checking purposes.</p><h2 id="compatibility-recommendations" tabindex="-1">Compatibility Recommendations <a class="header-anchor" href="#compatibility-recommendations" aria-label="Permalink to &quot;Compatibility Recommendations&quot;">​</a></h2><p>Stencil is in many regards an opinionated library, and includes much of the software necessary to get users building web components as quickly as possible. There are a few pieces of software that Stencil allows users to choose to best fit their team, organizational structure, and existing technical stack. The Stencil team has compiled a series of compatibility tables to describe the interoperability requirements of these pieces of software and Stencil.</p><h3 id="javascript-runtime" tabindex="-1">JavaScript Runtime <a class="header-anchor" href="#javascript-runtime" aria-label="Permalink to &quot;JavaScript Runtime{#javascript-runtime}&quot;">​</a></h3><table><thead><tr><th style="text-align:center;">Stencil Version</th><th style="text-align:center;">Node v10</th><th style="text-align:center;">Node v12</th><th style="text-align:center;">Node v14</th><th style="text-align:center;">Node v16</th><th style="text-align:center;">Node v18</th><th style="text-align:center;">Node v20</th></tr></thead><tbody><tr><td style="text-align:center;">V4</td><td style="text-align:center;">❌</td><td style="text-align:center;">❌</td><td style="text-align:center;">❌</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td></tr><tr><td style="text-align:center;">V3</td><td style="text-align:center;">❌</td><td style="text-align:center;">❌</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td></tr><tr><td style="text-align:center;">V2</td><td style="text-align:center;">❌</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">⚠</td><td style="text-align:center;">❌</td></tr><tr><td style="text-align:center;">V1</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">❌</td><td style="text-align:center;">❌</td></tr></tbody></table><h3 id="testing-libraries" tabindex="-1">Testing Libraries <a class="header-anchor" href="#testing-libraries" aria-label="Permalink to &quot;Testing Libraries&quot;">​</a></h3><h4 id="jest" tabindex="-1">Jest <a class="header-anchor" href="#jest" aria-label="Permalink to &quot;Jest&quot;">​</a></h4><table><thead><tr><th style="text-align:center;">Stencil Version</th><th style="text-align:center;">Jest v24</th><th style="text-align:center;">Jest v25</th><th style="text-align:center;">Jest v26</th><th style="text-align:center;">Jest v27</th><th style="text-align:center;">Jest v28+ *</th></tr></thead><tbody><tr><td style="text-align:center;">V4</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">❌</td></tr><tr><td style="text-align:center;">V3</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">❌</td></tr><tr><td style="text-align:center;">V2</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">❌</td></tr><tr><td style="text-align:center;">V1</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">❌</td><td style="text-align:center;">❌</td></tr></tbody></table><p>* Support for Jest 28+ will be released in an upcoming version of Stencil v4.</p><h4 id="puppeteer" tabindex="-1">Puppeteer <a class="header-anchor" href="#puppeteer" aria-label="Permalink to &quot;Puppeteer&quot;">​</a></h4><table><thead><tr><th style="text-align:center;">Stencil Version</th><th style="text-align:center;">Puppeteer v5-9</th><th style="text-align:center;">Puppeteer v10</th><th style="text-align:center;">Puppeteer v11-19</th><th style="text-align:center;">Puppeteer v20</th></tr></thead><tbody><tr><td style="text-align:center;">V4</td><td style="text-align:center;">❌</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td></tr><tr><td style="text-align:center;">V3</td><td style="text-align:center;">❌</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td></tr><tr><td style="text-align:center;">V2</td><td style="text-align:center;">✅</td><td style="text-align:center;">✅</td><td style="text-align:center;">❌</td><td style="text-align:center;">❌</td></tr><tr><td style="text-align:center;">V1</td><td style="text-align:center;">✅</td><td style="text-align:center;">❌</td><td style="text-align:center;">❌</td><td style="text-align:center;">❌</td></tr></tbody></table>',37),a=[i];function s(d,c,o,y,p,h){return e(),n("div",null,a)}const u=t(l,[["render",s]]);export{x as __pageData,u as default};
